      taskRule: '<p class="h6 font-weight-bold text-first">升級規則</p><p>1.每一等級皆有指定任務須達成，依照各等級的「任務進度條」指示完成升等任務。</p><p>2.當該級別指定升等任務全數達成時，「領取升等獎勵」按鈕將會開啟，點擊按鈕即可向上升一等級。</p><p>3.任務等級進度條將於UUPON APP內呈現，欲查詢您目前的會員等級及任務完成狀態，歡迎下載UUPON APP查詢。</p><br><p class="h6 font-weight-bold text-first">升等次數累積規則</p><p>1.完成各等級所指定之任務，進度條上所顯示的次數將會依完成狀況向上累加。</p><p>2.以下任務將於完成後48小時內給予達成的累加次數</p><p class="ml-2">A.每日簽到</p><p class="ml-2">B.點擊推播訊息</p><p class="ml-2">C.點擊APP U問卷</p><p>3.以下任務於完成後，將依照該「活動入點」或「序號入點」或「點數兌點」時間後的48小時內給予達成的次數累加。</p><p class="ml-2">A.完成會員資料填寫(含email認證)</p><p class="ml-2">B.超商消費累點</p><p class="ml-2">C.填寫U問卷</p><p class="ml-2">D.賺點活動</p><p class="ml-2">E.兌換兌好康商品 (貼心提醒：若活動為序號贈點，未避免會員權益受損，提醒會員在序號過期前，記得至「填序號賺點數」的頁面，填寫序號進行入點哦。)</p><p>4.「傳奇會員」及「大神會員」的等級任務中，「參與累點活動」任務指參與UUPON APP「賺點活動」內之活動，「U問卷填寫」、「玩任務專區」、「超商消費」、「轉點服務」等活動皆不計算入內，並於2021/1/1 起上線之活動開始計算。</p><p>5.以下任務一天僅會紀錄一次，並給予相對應的升等次數</p><p class="ml-2"> (ex. 11/16小美至超商消費3次，完成的紀錄僅計算1次)</p><p class="ml-2">(1)超商消費</p><p class="ml-2">(2)每日簽到</p><p class="ml-2">(3)點擊「U問卷」</p><p class="ml-2">(4)兌換兌好康</p><p class="ml-2">(5)點擊推播訊息</p><br><p class="h6 font-weight-bold text-first">等級效期及升等說明</p><p>1.各等級有效期限為180天，至點下「領取升等獎勵」按鈕後開始計算。</p><p>2.點下「領取升等獎勵」按鈕後，系統將會扣除升等所需的任務次數，完成後即可向上升等。</p><p>3.當等級180天期滿，若會員「未完成升等條件」或「未按下領取升等獎勵按鈕」，會員等級將會自動降至「見習會員」，但所完成的任務次數將不被扣除，可持續運用擁有的任務次數進行升等。</p><br><p class="h6 font-weight-bold text-first">會員獎勵制度</p><p>1.等級升等後即可擁有該級別會員的獎勵福利。</p><p>2.「傳奇會員」、「大神會員」的獎勵福利中，「各級別累點福利」僅包含於「賺點專區」內之累點活動 (不包含任何超商消費活動)，獎勵點數入點時間將依各累點活動入點後48小時內給予獎勵點數。相關獎勵點數活動，將從2021/1/1 起上線之活動開始計算，2021/1/1前皆不計算入內)</p><p>3. 「各級別累點福利」的入點獎勵，將依點數入點時，會員所屬的等級做贈點判斷，當入點時的會員等級為傳奇會員，將會以傳奇會員之贈點點數做贈點獎勵。</p><p>4.當等級升至「高手會員」、「傳奇會員」、「大神會員」，即可兌換VIP優惠商品，相關優惠品項可至兌好康VIP等級專區內查看。(優惠即將開啟，敬請期待)</p><br><p class="h6 font-weight-bold text-first">備註</p><p>1.點鑽整合行銷股份有限公司保留隨時變更、修改或終止本活動及約定條款之權利，若有異動，修改後的活動內容將公佈在網站上，建議您隨時注意該等修改或變更。您於任何修改或變更後繼續使用本服務時，視為您已閱讀、瞭解並同意接受該等修改或變更。</p><p>2.會員分級之相關等級效期，自點下「領取升等獎勵」後維持180天，異動均以會員分級辦法內呈現為準，點鑽整合行銷不會以會員升級或專屬活動等名義要求您另行支付費用，若您接獲類似通知請勿相信，，如有疑問歡迎來信至客服信箱cs@uupon.tw。</p>',
